/* eslint-disable jsx-a11y/heading-has-content */
import './App.css';
import React, {Component} from 'react';
import Header from './components/Header';
// import Product from './components/Product';
// import Footer from './components/Footer';

class App extends Component{
  showInfoProduc(product){
    if(product.status){
      return (
        <h3 className='mg-left-30'>
            ID: {product.id} <br/>
            name: {product.name} <br/>
            price: {product.price} <br/>
            status: {product.status ? "Actice" : "pending"} <br/>
       </h3>
      )
    }
  }

  render(){
    var product ={
      id : 1,
      name : 'iphone 7 plus',
      price : 200000,
      status : false
    }

    return(
      <div>
        <Header></Header>
        <div className="row">
          <div className="col-xs-5 col-sm-5 col-md-5 col-lg-5">
            {/* <Product></Product> */}
          </div>
           {this.showInfoProduc(product)}
        </div>
        {/* <Footer></Footer> */}
      </div>
    )
  }

}



export default App;
